import React, { Component } from 'react'

export default class WinnersPanel extends Component {
  constructor(props) {
    super(props);
  }
  render(){
    console.log(this.props.userDetail);
    return(
      <div>
        <table>
        <tr><th>Rank</th><th>Winner Address</th><th>Amount</th></tr>
        {(this.props!==undefined&&this.props.userDetail!==undefined)?this.props.userDetail.winnerArr.map((address,index)=>{<tr><td>{index}</td><td>{address}</td><td>{this.props.userDetail.winnerAmountArr[index]}</td></tr>}):''
        }
        </table>
      </div>
    );
  }
}
